import React, { useEffect, useState, Fragment } from "react";

const AutoPolicyDashboard = () => {
  const [autos, setAutos] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8080/api/auto/950416")
      .then((res) => res.json())
      .then((data) => setAutos([...autos, ...data]));
  }, []);
  return (
    <div className="row">
      <div className="col-6">
        <li className="h5 list-group-item list-group-item-primary">
          List of Automobiles on This Policy
        </li>
        {autos.map((auto) => {
          return (
            <Fragment key={auto.vin}>
              <li className="list-group-item list-group-item-success mt-3">
                Automobile VIN number
              </li>
              <li className="list-group-item">{auto.vin}</li>
              <li className="list-group-item list-group-item-success">Make</li>
              <li className="list-group-item">{auto.make.capitalize()}</li>
            </Fragment>
          );
        })}

        {/* <ul className="list-group">
          <li className="list-group-item list-group-item-primary">
            This is a primary list group item
          </li>
        </ul> */}
      </div>
      <div className="col-6 align-items-end">
        <ul className="list-group">
          <li className="list-group-item list-group-item-warning h5">
            This is a primary list group item
          </li>
        </ul>
      </div>
    </div>
  );
};

export default AutoPolicyDashboard;
